import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import "../App.css";

const ComplaintDetailsPage = () => {
  const { id } = useParams(); // Get complaint ID from URL
  const [complaint, setComplaint] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchComplaintDetails = async () => {
      try {
        const response = await axios.post(
          "https://babralaapi-d3fpaphrckejgdd5.centralindia-01.azurewebsites.net/getComplaintsByDateRange",
          {
            startDate: "2025-02-19T00:00:00Z",
            endDate: "2025-02-26T23:59:59Z",
          }
        );

        const complaints = response.data;

        // Find the complaint with the matching ID
        const selectedComplaint = complaints.find((c) => c.ComplaintID.toString() === id);

        if (selectedComplaint) {
          setComplaint(selectedComplaint);
        } else {
          console.error("Complaint not found.");
        }
      } catch (error) {
        console.error("Error fetching complaint details:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchComplaintDetails();
  }, [id]);

  if (loading) {
    return <div className="loading">Loading Complaint Details...</div>;
  }

  if (!complaint) {
    return <div className="error">Complaint not found.</div>;
  }

  return (
    <div className="complaint-details-container">
      <h2>Complaint Details</h2>

      <div className="complaint-info">
        <p><strong>Complaint ID:</strong> {complaint.ComplaintID}</p>
        <p><strong>User ID:</strong> {complaint.UserID}</p>
        <p><strong>Complaint Type:</strong> {complaint.ComplaintsType}</p>
        <p><strong>Complaint Status:</strong> {complaint.ComplaintsStatus}</p>
        <p><strong>Mobile No:</strong> {complaint.MobileNo}</p>
        <p><strong>Description:</strong> {complaint.Description}</p>
        <p><strong>Location:</strong> {complaint.Location}</p>
        <p><strong>Created By:</strong> {complaint.CreatedBy}</p>
        <p><strong>Created Date:</strong> {new Date(complaint.CreatedDate).toLocaleString()}</p>
        
        {/* Document Link */}
        {complaint.Document && (
          <p><strong>Document:</strong> 
            <a href={complaint.Document} target="_blank" rel="noopener noreferrer" className="download-link">
              Download Document
            </a>
          </p>
        )}

        {/* Photo */}
        {complaint.Photo && (
          <>
            <p><strong>Photo:</strong></p>
            <img src={complaint.Photo} alt="Complaint" className="complaint-photo" />
          </>
        )}
      </div>

      {/* Action Buttons */}
      <div className="button-group">
        <button className="btn reply">Reply</button>
        <button className="btn close">Close Complaint</button>
        <button className="btn back">Back</button>
      </div>
    </div>
  );
};

export default ComplaintDetailsPage;
